// --- Core Cryptographic Primitives ---

// Scalar represents an element in Z_Q (the order of the group).
type Scalar struct {
	Value *big.Int
}

// NewScalar creates a new Scalar from an int64.
func NewScalar(val int64) Scalar {
	return Scalar{Value: big.NewInt(val)}
}

// NewScalarFromBigInt creates a new Scalar from a big.Int.
func NewScalarFromBigInt(b *big.Int) Scalar {
	return Scalar{Value: new(big.Int).Set(b)}
}

// Add adds two Scalars modulo Group.Q.
func (s Scalar) Add(other Scalar) Scalar {
	res := new(big.Int).Add(s.Value, other.Value)
	res.Mod(res, Group.Q.Value)
	return Scalar{Value: res}
}

// Sub subtracts two Scalars modulo Group.Q.
func (s Scalar) Sub(other Scalar) Scalar {
	res := new(big.Int).Sub(s.Value, other.Value)
	res.Mod(res, Group.Q.Value)
	return Scalar{Value: res}
}

// Mul multiplies two Scalars modulo Group.Q.
func (s Scalar) Mul(other Scalar) Scalar {
	res := new(big.Int).Mul(s.Value, other.Value)
	res.Mod(res, Group.Q.Value)
	return Scalar{Value: res}
}

// Neg negates a Scalar modulo Group.Q.
func (s Scalar) Neg() Scalar {
	res := new(big.Int).Neg(s.Value)
	res.Mod(res, Group.Q.Value)
	return Scalar{Value: res}
}

// Inverse computes the modular multiplicative inverse of a Scalar modulo Group.Q.
func (s Scalar) Inverse() Scalar {
	res := new(big.Int).ModInverse(s.Value, Group.Q.Value)
	return Scalar{Value: res}
}

// Equal checks if two Scalars are equal.
func (s Scalar) Equal(other Scalar) bool {
	return s.Value.Cmp(other.Value) == 0
}

// GroupElement represents an element in the cyclic group G.
type GroupElement struct {
	Value *big.Int
}

// Equal checks if two GroupElements are equal.
func (ge GroupElement) Equal(other GroupElement) bool {
	return ge.Value.Cmp(other.Value) == 0
}

// Mul performs scalar multiplication (g^x) where g is a GroupElement and x is a Scalar.
func (ge GroupElement) Mul(scalar Scalar) GroupElement {
	res := new(big.Int).Exp(ge.Value, scalar.Value, Group.P.Value)
	return GroupElement{Value: res}
}

// Add performs group multiplication (g * h) where g and h are GroupElements.
func (ge GroupElement) Add(other GroupElement) GroupElement {
	res := new(big.Int).Mul(ge.Value, other.Value)
	res.Mod(res, Group.P.Value)
	return GroupElement{Value: res}
}

// Neg computes the inverse of a GroupElement (g^-1).
func (ge GroupElement) Neg() GroupElement {
	// g^-1 mod P is g^(P-2) mod P by Fermat's Little Theorem
	exp := new(big.Int).Sub(Group.P.Value, big.NewInt(2))
	res := new(big.Int).Exp(ge.Value, exp, Group.P.Value)
	return GroupElement{Value: res}
}

// Group holds the parameters of the cyclic group.
type Group struct {
	P *Scalar      // Large prime modulus for the field
	Q *Scalar      // Order of the subgroup (Q divides P-1)
	G GroupElement // Generator of the group
	H GroupElement // Second independent generator for Pedersen commitments
}

